const CACHE_NAME="app-cache-v1",urlsToCache=["/","/index.html","/main.js"];self.addEventListener("install",(e=>{e.waitUntil(caches.open(CACHE_NAME).then((e=>e.addAll(urlsToCache))))})),self.addEventListener("fetch",(e=>{if("GET"!==e.request.method)return e.respondWith(fetch(e.request));e.respondWith(caches.match(e.request).then((t=>t||fetch(e.request))))})),self.addEventListener("activate",(e=>{e.waitUntil(caches.keys().then((e=>Promise.all(e.filter((e=>e!==CACHE_NAME)).map((e=>caches.delete(e)))))))}));